import React from 'react';
import Col from 'react-bootstrap/Col';

const Card = (props) => {
    return (
    <Col md={4} className="card-container">
        <img src={props.img}/>
        <h1>{props.name}</h1>
        <p>{props.color}</p>
        <p>{props.description}</p>
    </Col>
    )
}

export default Card;
